import './App.css';
import Navbar from './Components/Navbar';
import ProfilePic from './Assets/profile_crop_2.png';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div
        style={{
          display: 'flex',
          justifyContent: 'center',
          color: 'hsl(34, 100%, 50%)',
          fontSize: '3em',
        }}
      >
        <strong>Aloha</strong>
      </div>
      <div className="profile">
        <img className="profpic" src={`${ProfilePic}`} height="500px" />
      </div>
    </div>
  );
}

export default App;
